def superDigit(n, k):
    s=str(n)*k
    while len(s)!=1:
        s=sum([int(i) for i in s])
        s=str(s)
    return int(s)

def sumofdigits(n,k):
    s=0
    while n>0:
        s+=n%10
        n//=10
    return s*k
def superDigit(n,k):
    x=sumofdigits(n,k)
    while x//10!=0:
        x=sumofdigits(x, k)
    return x

def superDigit(n, k):
    x=int(n)*k%9
    return x if x else 9
